import React, { useState, useEffect } from "react";
import Typed from "react-typed";
import "./Home.css";

const Home = () => {
  let texts = ["Hello, I am Zakaria Dani", "Hello, I am a Software Engineer"];
  return (
    <div id="home">
        <Typed
            strings={texts}
            typeSpeed={40}
            backSpeed={50}
            loop
          />
          <p>A Web Developer passionate about creating interactive applications and experiences on the web.</p>
          <div id="socialMedia">
            <button id="resume">Resume</button>
            <button id="linkedin">linkedin</button>
            <button id="gitHub">gitHub</button>
          </div>
    </div>
  );
};

export default Home;
